import {CardMedia, Container, Grid, Paper, Typography} from "@mui/material";

interface CertificateProp {
    recipientName: string
    courseDuration: number;
}

const Certificate = (prop: CertificateProp) => {
    const getCurrentDate = () => {
        const currentDate = new Date();
        const year = currentDate.getFullYear();
        const month = String(currentDate.getMonth() + 1).padStart(2, '0'); // Zero-padding for single-digit months
        const day = String(currentDate.getDate()).padStart(2, '0'); // Zero-padding for single-digit days
        return `${year}-${month}-${day}`;
    }

    return (
        <Paper sx={{
            width: '800px',
            height: '600px',
            margin: '50px auto',
            padding: '20px',
            textAlign: 'center',
        }} elevation={3}>
            <Grid container spacing={1}>
                <Grid item xs={12} sx={{
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    justifyContent: 'center',
                    height: '100%',
                }}>
                    <CardMedia component='img'
                               src={base64Image}
                               sx={{width: 150, height: 150}}/>
                </Grid>
                <Grid item xs={12} sx={{
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    justifyContent: 'center',
                    height: '100%'
                }}>
                    <Typography variant="h2" sx={{fontFamily: 'fantasy'}} id={"certificationTitle"}>CERTIFICATE</Typography>
                </Grid>
                <Grid item xs={12} sx={{
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    justifyContent: 'center',
                    height: '100%',
                }}>
                    <Typography variant="h3" sx={{fontFamily: 'fantasy'}}>of Completion</Typography>
                </Grid>
                <Grid item xs={12} sx={{
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    justifyContent: 'center',
                    height: '100%',
                }}>
                    <Typography variant="h5" sx={{
                        marginBottom: '20px',
                        fontSize: '24px',
                        fontWeight: 'bold',
                        fontFamily: 'monospace'
                    }}>
                        {prop.recipientName}
                    </Typography>
                </Grid>
                <Grid item xs={12} sx={{
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    justifyContent: 'center',
                    height: '100%',
                }}>
                    <Typography variant="body1" sx={{marginBottom: '30px',}}>
                        For completing {prop.courseDuration} days of practical courses
                    </Typography>
                </Grid>

                <Grid item xs={6} sx={{
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    justifyContent: 'center',
                    height: '100%',
                }}>
                    <Typography variant="body1" sx={{marginBottom: '30px',}}>
                        Signature
                        <CardMedia component='img'
                                   src={signatureBase64Image}
                                   sx={{width: 100, height: 100}}/>
                    </Typography>
                </Grid>
                <Grid item xs={6} sx={{
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    justifyContent: 'center',
                    height: '100%',
                }}>
                    <Typography variant="body1" sx={{marginBottom: '30px',}}>
                        Date: {getCurrentDate()}
                    </Typography>
                </Grid>
            </Grid>
        </Paper>
    );
}

const signatureBase64Image: string = "data:image/png;base64,"
const base64Image: string = "data:image/png;base64,"

export default Certificate;